import Externo from '../models/externo';

export async function getExterno(req,res) {
    try{
        const externo = await Externo.findAll();
        res.json({
            data: externo
        });
    } catch (e) {
        console.log(e);
    }
   
}

export async function crearExterno(req, res) {
