    },
    asunto: {
        type: Sequelize.TEXT
    },
    fecha_inicio: {
        type: Sequelize.TEXT
    },
    profesional: {
        type: Sequelize.TEXT
    },
    disposicion_def: {
        type: Sequelize.TEXT
    },
    
    
    
}, {
    timestamps:false
});


Mensura.hasMany(TramiteA, { foreignKey: 'tramite_id'});

export default Mensura;

